script: |
  super -f text -I q10423.spq | sort > q10423.out

inputs:
  - name: q10423.spq
    data: |
      SELECT ALL + + col2 + - + col2 + col1 * - col2 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT - 73 BETWEEN - col2 + - ( - - ( + - col0 ) ) + + 12 AND NULL;
  - name: tab2

outputs:
  - name: q10423.out
    data: |
      -1173
      -3080
      -3886
